import React, { Component } from "react";

export default class Count extends Component {
    constructor() {
      super();
      this.state = {
        count: 0
      };
    }

    incrementCount = () => {
      this.setState({
        count: this.state.count + 1
      });
    };

    decrementCount = () => {
      this.setState({
        count: this.state.count - 1
      });
    };

    render() {
      let { count } = this.state;
      return (
        <div className="buttons">
                <button className="btn btn-danger" onClick={this.decrementCount}><i class="fas fa-minus"></i></button>
                <h2>{count}</h2>
                <button className="btn btn-primary" onClick={this.incrementCount}><i class="fas fa-plus"></i></button>
                <div>
                    <p clas></p>
                </div>
            </div>
      );
    }
  }
